  assemblies:
  - BOOSEide
  namespace: BOOSEide
  summary: >-
    Executes the variable evaluation.

    - If Expression is blank, sets value to 0.0.  

    - Otherwise evaluates the expression using <xref href="BOOSEide.AppStoredProgram.EvaluateExpression(System.String)" data-throw-if-not-resolved="false"></xref>.  

    - Throws <xref href="BOOSE.StoredProgramException" data-throw-if-not-resolved="false"></xref> if the evaluated value cannot be converted to double.  

    - Updates the program with the current value.
